  "text" : "近年のGPUの性能比較表を作ってみた。主に計算力学で使うために倍精度演算の速度に重点を置いて整理したんですが、あってるかあまり自信ない。どうでしょう？＞GPGPUer各位 http://t.co/6CgUVEqC",
