  "geo" : {
  },
  "id_str" : "227767505899364352",
  "text" : "「今年はセミが鳴くのが遅いね異常だ」とか「今年は暑いね異常気象だ」とか言うけど、毎年観測してたりしない限り、普通は去年のセミがいつ鳴いたとかどんな暑さだったかなんて覚えてない。結局、そういう人は自分の与り知らぬところで起きている何かに翻弄されている自分を演じたいだけなんだと思う。",
  "id" : 227767505899364352,
