  "text" : "今日はつい数日前に発売さればかりの『数値波動水槽』（土木学会）を手に入れた。MPS法含めて粒子法も、もちろんVOFのような格子法もそれ以外も、水の波の計算に関する計算手法を網羅的に知ることができる。A4サイズで200ページで3000円はお得だと思った。帰ってじっくり読む。 [l]",
