  "text" : "ちなみに、三本の矢をまとめて折ろうとするということは曲げ破壊を起こそうとしてるはずなので、太い矢を一番外側に配置すれば、より強度が出るはず。プロジェクトの例にならうのであれば、一番負荷のかかる部分を見極め、そこに能力のある人を割り当てるが良し、ということでしょうかね？ [l]",
