  "id_str" : "223605288643727360",
  "text" : "太さが異なる三本の矢を折ると太い矢に応力集中してとかいう話、同じ断面積ならどれかが太かろうが強度が落ちるわけではないし、むしろ連続面積が増える分強度は増すはずなんですが。まぁそんなことまでは普通の人は考え至らないのかなぁ、とRTが回ってくる度に思いつつ。 [l]",
