  "text" : "例えば、近所で大きな土木工事（橋なり道路なりダムなり）があったとして、すごーく便利になったりしたとする。でも、それを手がけた企業の名前すら世の人たちは知らないというのも確か。5大ゼネコンの名前1つも分からない人が大半だと思うし。 [l]",
