  "text" : "大体において、一般的に認識されている理系像では、理系は言葉の裏に意味など込めず直接的に率直な意見を言うはずなので、 #文系ってイイなと思えるコピー のようなことを言ったら、その理系は、ほんとに、月が綺麗だと思ったり寒がったり雨を鬱陶しいと思ってるってだけなはずです。",
