  "text" : "肌白いからもっと外に出ろだとか、痩せてるからもっと食べろだとか、結局、人は見た目でしか何かを評価することは出来ず、しかもその修正を（既に過去において効果が薄いことが分かっていることを愚かにも）ありふれた直接対処しかできず、同じことを繰り返し、なお学ばないものなのですね。",
