  "text" : "#今日の夢 実家で出かけようとしたら、どっかからシマリス2匹とウサギ1匹とフェレット1匹（いずれも人懐っこい）が迷い込んできて、出かけるのやめてそれを保護してたら、実は2つ上の階でカフェをやってたが数日前に失踪した老夫婦のところから逃げてきたことが判明し、事件に巻き込まれていく話",
